import google from './google-play-badge.png'

function App() {
  return (
    <div className='container'>
      <div className='hero'>
        <h1>StorySprout</h1>
        <p>Never-ending stories for kids and their big people.</p>
      </div>

      <div className='button-container'>
        <img src={google} alt='play store link' className='play-store-link'/>
        <button className='appstore-button'>App Store</button>
        <button className='appstore-button'>Google Play</button>
      </div>

      <div className='footer'>
        <a href=''>Privacy Policy</a>
        <a href=''>Terms of Use</a>
      </div>



    </div>
  );
}

export default App;
